import logo from './logo.svg';
import './App.css';
import Home from './page/Home';
import {BrowserRouter as Router, Routes, Navigate} from 'react-router-dom';

function App() {
  return (
    <Router>
      <Routes>
      <Routes path="/" element={Home}/>
      </Routes>
    </Router>
  );
}

export default App;
